import './Login.css';
import Logo from './logo.png';
import nameDV from './namesystem.png';

function Login(){
    return(
        <div>
            <div className="logo">
                <img src={Logo} alt=""/>
            </div>

            <div className="img">
                <img src={nameDV} alt=""/>
            </div>

            <div className="login">
                <form method="">
                    <input type="email" placeholder="Enter email" required="required"/>
                    <input type="password" placeholder="Enter password" required="required"/>
                    <button type="submit" className="btn btn-primary btn-block btn-large">Sign In</button>
                </form>
                <a style={{padding:'10px'}} href="">If you forgot password, Click here</a>
            </div>               
        </div>
    );
}
export default Login;
